const backendDomain = "http://localhost:8080"
const summaryApi = {
    SignUp: {
        url:`${backendDomain}/api/sign-up`,
        method:"post",
    },
    SignIn: {
        url:`${backendDomain}/api/sign-in`,
        method:"post",
    },
    currentUser:{
        url:`${backendDomain}/api/user-details`,
        method:"get",
    }
}

export default summaryApi
